import React from 'react';

import styles from './../Style/Components/Servers.module.css';

//Modules 
import Server from './Server';

let Servers = () => {

  const Name = 'Test';
  const id = 123;
  const id2= 1234;
  const Selected = 123;
  return (
    <section className={styles.Container}>
      <Server Name={Name} id={id} Active={Selected}/>
      <Server Name={Name} id={id2} Actove={Selected}/>
    </section>
  );
}

export default Servers;
